import Link from 'next/link';


const Navbar = () => (

    
        <ul>
             <li><Link href = "/home"> <a> Home </a> </Link> </li>
            <li><Link href = "/about"> <a> about </a> </Link> </li>
            <li><Link href = "/contact"> <a> contact </a> </Link> </li>
        </ul>

    

);

export default Navbar;
